import { useNavigate } from "react-router-dom";

const DashboardPage = () => {
  const navigate = useNavigate();
  const handleMenuCLick = () => {
    navigate("/menu");
  };
  return (
    <div className="">
      <h1>To menu</h1>
      <button className="btn btn-primary" onClick={handleMenuCLick}>
        Menu
      </button>
    </div>
  );
};

export default DashboardPage;
